import React from "react";
import { NavLink } from "react-router-dom";

const Notes = () => {

return(
    <>
    
    
    <div className="container">

      <h1 className="bg-danger text-white">Uploaded Files </h1>
      <NavLink to="/study" ><h2 className="text-right text-decoration-none p-1 bg-success text-white btn btn-light">Upload</h2></NavLink>
      
        <div className="row">
                
        <h1 id="notes">Subject Notes</h1>
          
          </div>
        </div>
      
    
    </>
);
};
export default Notes;
